import ExpenseItem from './ExpenseItem'

function ExpenseItemDisplay(props) {
  return (
    <div>
      <ExpenseItem>
        {props.item[0].title}
        {props.item[0].amount}
        {props.item[0].date}
      </ExpenseItem>
    </div>
  );
}

export default ExpenseItemDisplay;
